class TOD extends Component {
  render(){
    console.log('tod.js 렌더링 완료')
    var lists = []
    var i = 0
    var data = this.props.data
    for(i = 0; i < 3 ;i++){
      lists.push(
        <li key={data[i].id} ><a href='/' onClick={function(i){
          e.preventDefault();
          this.props.onChangePage();
        }.bind(this)}>{data[i].title}</a></li>
      ) 
  }
    return (
      <nav>
        <ul>
          {lists}
        </ul>
      </nav>
    );
  }
  }

  export default TOD;
